import React from 'react';

import Images from "./Images";
import ScrollButton from "../../helpers/ScrollButton";

function RowImages(props) {
    return (
        <div className="row">
            <div className="row" style={{
                width: "100%",

            }}>
                <Images></Images>
                <Images></Images>
                <Images></Images>
            </div>
            <div>
                <ScrollButton></ScrollButton>
                <ScrollButton></ScrollButton>
            </div>
        </div>
    );
}

export default RowImages;
